import { createIcon } from "../icon/createIcon";

export const ExportSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ExportSolidIcon">
    <path d="M12 0v12H0V0h12zM5 1H1v10h4v-1H2V2h3V1zm3 2-.001 1.99H3v1.99h4.999L8 9l4-3.015L8 3z" />
  </svg>,
  "ExportSolid",
  "export solid"
);
